import { useLocation, useParams } from "react-router-dom";

interface LocationState{
    state: {
        name:string;
        rank:number;
    }
}

function Coin() {
    const { coinId } = useParams();
    const {state} = useLocation() as LocationState;
    return (
        <h1>Coin: {coinId}</h1>
    )
}

export default Coin;
